import{_ as i}from"./plugin-vue_export-helper-c27b6911.js";import{o as a,c as l,d as e}from"./app-9107e99b.js";const h={},r=e('<h1 id="主管面" tabindex="-1"><a class="header-anchor" href="#主管面" aria-hidden="true">#</a> 主管面</h1><h2 id="自我介绍" tabindex="-1"><a class="header-anchor" href="#自我介绍" aria-hidden="true">#</a> 自我介绍</h2><h3 id="自我介绍-1" tabindex="-1"><a class="header-anchor" href="#自我介绍-1" aria-hidden="true">#</a> 自我介绍</h3><p>面试官您好，我是刘大维，来自东北大学软件工程专业大三年级。我将从三个方面来介绍我自己：</p><p>首先，我热爱技术研发，学习能力良好。我在大学期间成绩优异，平均学分绩点为92.5，荣获国家奖学金。我具有良好的java基础以及扎实的开发能力，我主导开发的两个项目获得了国家二等奖、字节跳动青训营一等奖的优异成绩。</p><p>其次，我具有良好的沟通能力和强烈的责任心，无论是在平时的课程项目中，还是在科创竞赛中，我都经常担任团队组长，在项目管理过程中会提前梳理工作量，结合每个人的优势特长分配工作。</p><p>最后一个方面是，我勤奋好学、善于总结思考。我认为细致、踏实才能真正掌握知识点，在学习新技术的过程中，我往往会反复实践。我在过往的学习中，养成了写总结笔记的习惯，并且放在了我的个人博客上。</p><h3 id="职业规划" tabindex="-1"><a class="header-anchor" href="#职业规划" aria-hidden="true">#</a> 职业规划</h3><p>短期来看，我将通过企业的实习和日常的积累不断提升技能和经验。</p><ol><li>我会继续学习高级知识，如微服务架构、分布式系统的设计。</li><li>通过在企业中实习，参与生产项目研发，增加开发经验。</li><li>争取早日成为独当一面的后端开发工程师。</li></ol><p>中长期来看，我深耕后端领域的研发</p><ol><li>提高系统设计的能力</li><li>增加高并发、高可用系统的开发经验</li><li>争取早日成为后台系统的技术专家和架构师</li><li>并带领一个高效和协作的团队，共同完成一些重要的项目</li></ol><p>短期来看，我将通过企业的实习和日常的积累不断提升技能和经验。</p><ol><li>接下来可以学习高级知识，如微服务架构、分布式系统和数据库设计。</li><li>不断实践和练习，并参与项目开发，增加工作经验。</li><li>参加行业会议和研讨会，了解最新技术和发展趋势。</li><li>尝试不同的领域和项目类型，扩大自己的技能和经验。</li><li>可以考虑进修相关的管理课程，提升领导能力和管理经验。</li></ol><p>争取早日成为独当一面的后端开发工程师</p><p>中长期来看，我深耕后端领域</p><ol><li>提高系统设计的能力</li><li>增加高并发、高可用系统的开发经验</li><li>争取早日成为后台系统的技术专家和架构师</li></ol><h5 id="三年后工作状态" tabindex="-1"><a class="header-anchor" href="#三年后工作状态" aria-hidden="true">#</a> 三年后工作状态</h5><p>我希望在我的职业生涯中取得了显著的进步和发展。作为一名在数据通信部门的工程师，我希望能够在技术方面取得深入的专业知识和经验，并成为该领域的专家之一。我希望能够运用我所学到的知识和技能，参与并领导一些关键的项目。</p><p>未来几年，随着5G、物联网、云计算等技术的发展，数据通信部门的软件开发工程师将会有更多的机会和挑战。例如，5G技术的普及将会带来更多的应用场景，需要软件开发工程师开发和维护相关的软件系统；物联网技术的发展将会带来更多的设备和数据，需要软件开发工程师开发和维护相关的数据通信系统；云计算技术的发展将会带来更多的云服务，需要软件开发工程师开发和维护相关的云服务系统。</p><p>因此，作为一名数据通信部门的软件开发工程师，我会关注这些技术的发展趋势，并不断学习和提升自己的技能，以适应未来的工作需求。</p><h3 id="优缺点" tabindex="-1"><a class="header-anchor" href="#优缺点" aria-hidden="true">#</a> 优缺点</h3><p>优点：学习力强、责任心强、技术过硬（、勤奋好学）</p><ul><li><p>我在学术方面取得了出色的成绩或者具备特定的专业技能，你可以强调这些优势。例如，你可以提到你在相关领域的学习成绩、项目经验或者获得的专业认证。</p></li><li><p>团队组长，进度管理质量把控</p></li><li><p>多次参与开发类的比赛并获得奖项</p><p>缺点：缺乏企业生产实践中的项目开发经验，对企业中的开发流程不熟悉。</p></li></ul><h3 id="评价" tabindex="-1"><a class="header-anchor" href="#评价" aria-hidden="true">#</a> 评价</h3><h5 id="他评" tabindex="-1"><a class="header-anchor" href="#他评" aria-hidden="true">#</a> 他评</h5><p>学习力强、技术过硬、勤奋好学，分别体现在：</p><ul><li>学业成绩优秀，平均学成绩 92.5 分，一直位列年纪前列并荣获国奖等荣誉。</li><li>开发过多个项目，如雁过留痕、仿掘金官网，这些项目均取得了优异的成绩，在这些项目中，我都承担了后端核心业务的开发。</li></ul><h5 id="自评" tabindex="-1"><a class="header-anchor" href="#自评" aria-hidden="true">#</a> 自评</h5><p>有创造力、有责任心、积极进取</p><h2 id="项目" tabindex="-1"><a class="header-anchor" href="#项目" aria-hidden="true">#</a> 项目</h2><h3 id="介绍项目-分工、优化、难点" tabindex="-1"><a class="header-anchor" href="#介绍项目-分工、优化、难点" aria-hidden="true">#</a> 介绍项目（分工、优化、难点）</h3><h4 id="雁过留痕" tabindex="-1"><a class="header-anchor" href="#雁过留痕" aria-hidden="true">#</a> 雁过留痕</h4><p>雁过留痕 Trace Note 是一款基于地点的社交 app。用户可以在一个地点开启一个 Trace AR 场景，并在场景中放置 Note 虚拟留言板，不同用户见可以在同一个 Trace 中相互交互评论。Note 留言板提供字体、材质等个性化装饰选项。用户可以通过连续签到打卡获取代币，用来抢购个性化装扮，以提高个性化程度，并作为激励机制提高用户每日的活跃度。</p><h4 id="仿掘金官网" tabindex="-1"><a class="header-anchor" href="#仿掘金官网" aria-hidden="true">#</a> 仿掘金官网</h4><p>一款类掘金的知识分享平台。我们利用 TrustSVD 社交推荐算法，实现了基于用户个人偏好及社交关系的个性化推荐系统。用户可以发布文章、收藏文章、评论互动（隐式）、关注作者，以及获得个性化推荐结果。</p><h4 id="展示项目-找出代码展示" tabindex="-1"><a class="header-anchor" href="#展示项目-找出代码展示" aria-hidden="true">#</a> <strong>展示项目</strong>（找出代码展示！）</h4><h4 id="挫折" tabindex="-1"><a class="header-anchor" href="#挫折" aria-hidden="true">#</a> 挫折</h4><p>在我去年暑假期间，我参加了移动应用创新赛，我们的团队致力于开发一个综合型的AR社交APP。我们设定了高目标，希望能够在规定的时间内完成一个功能丰富且稳定的应用。</p><p>然而，我们在开发过程中遇到了一系列的挑战。首先，我们的团队在初期对项目的范围和技术要求有些过于乐观，导致我们在开发过程中遇到了时间紧迫和资源不足的困境。</p><p>其次，我们遇到了一些技术难题。由于项目要求较高，我们需要掌握一些新的技术和框架。然而，我们在学习和应用这些新技术时遇到了困难，并且在某些功能的实现上遇到了一些 bug 和兼容性的问题。</p><p>在比赛的中期阶段，我们感到非常沮丧和挫折。项目进展不如预期，而且时间越来越紧迫，难以完全实现项目立项时设立的愿景。</p><p>然而，我们没有放弃，而是通过团队会议和讨论来共同寻找解决方案。</p><p>我们决定重新评估项目的优先级和功能范围，将实现的重点放在核心功能的实现上，并推迟了一些次要功能。我们与小组的指导导师和其他同学进行交流，并得到了一些宝贵的建议和指导。我们也积极调研市面上成熟的解决方案，寻求其他开发者的帮助和经验分享。</p><p>最终，在比赛截止日期前的最后几天，我们成功地完成了核心功能并解决了大部分 bug。虽然我们没有完全实现最初设想的所有功能、也并没有斩获一等奖的成绩，但我们应用的核心功能在比赛中获得了评委的好评，并取得了不错的成绩。</p><p>通过这个挫折的经历，我学到了很多关于团队合作、项目管理和技术应用的重要教训。我学会了灵活调整项目计划和目标，同时善于寻求他人的帮助和指导。这个经历使我更加注重解决问题的能力和适应能力，同时也加深了我对软件开发过程中团队协作的理解。</p><h4 id="失败经历" tabindex="-1"><a class="header-anchor" href="#失败经历" aria-hidden="true">#</a> 失败经历</h4><p>推荐系统导论这门课程最后的小组论文中，我们由三个同学分领域进行了调研和撰写。由于过于信赖另外的两位同学的工作成果物，没有过多检查</p><p>失败的团队合作经历，由于时间紧急，最后没有统一开会同步成果</p><h2 id="学生工作" tabindex="-1"><a class="header-anchor" href="#学生工作" aria-hidden="true">#</a> 学生工作</h2><ul><li>大一学年，在院学生会学业规划中心学术交流部作为干事，在任职期间，我主要承办了辅学活动的工作，我发挥了高数的专长，担任了高数讲师的工作，为需要帮助的同学们讲解高数知识，分享高数刷题的方法和思路，得到了同学们的好评。</li><li>大二学年，在校团委能力拓展中心交流部任部长一职，由于大二学年疫情严重，学校所有的线下活动全部取消，我们并没有向往年一样承办很多活动，不过校团委举办了一些线上的活动，我负责了向部员分工、与各学院团委对接活动的职责。</li></ul><h2 id="岗位相关" tabindex="-1"><a class="header-anchor" href="#岗位相关" aria-hidden="true">#</a> 岗位相关</h2><h3 id="通用软件开发工程师" tabindex="-1"><a class="header-anchor" href="#通用软件开发工程师" aria-hidden="true">#</a> 通用软件开发工程师</h3><p>它是一项非常有前途的职业，随着技术的不断发展，软件开发工程师的需求也在不断增加。此外，软件开发工程师还可以在许多不同的行业中找到工作机会。通用软件开发工程师是一种更加通用的职位，可以在许多不同的行业中找到工作机会。</p><h3 id="数据通信产品线" tabindex="-1"><a class="header-anchor" href="#数据通信产品线" aria-hidden="true">#</a> 数据通信产品线</h3><p>华为数据通信产品线是华为公司的一个重要部门，致力于提供高质量、高性能、高可靠性的数据通信产品和解决方案。该产品线的主要业务包括固定网络、移动网络、云核心网、传输网络、数据中心网络等。</p><h3 id="🌟-why-华为-在华为实习希望的收获" tabindex="-1"><a class="header-anchor" href="#🌟-why-华为-在华为实习希望的收获" aria-hidden="true">#</a> 🌟 why 华为｜在华为实习希望的收获</h3><p>华为是一家全球领先的信息和通信技术（ICT）解决方案提供商。华为的原因可能是因为它是一家全球知名的公司，拥有广泛的业务范围和多样化的产品线。并且华为在技术创新方面也非常强大，我认为如果能有幸加入这样的企业，会让我在企业级的开发技术和行业前沿视野等多方面受益匪浅。</p><h3 id="华为的企业文化" tabindex="-1"><a class="header-anchor" href="#华为的企业文化" aria-hidden="true">#</a> 华为的企业文化</h3><p><strong>以客户为中心，以奋斗者为本，长期艰苦奋斗，坚持自我批判。</strong></p><p>华为的企业文化核心是以客户为中心，以奋斗者为本。华为的企业文化可以用这样的几个词语来概括：团结，奉献，学习，创新，获益与公平。</p><p>华为的企业文化又叫做狼性文化，它有四个特点：一是学习，二是创新，三是获益，四是团结。</p><h3 id="华为近几年处境不好会不会有顾虑" tabindex="-1"><a class="header-anchor" href="#华为近几年处境不好会不会有顾虑" aria-hidden="true">#</a> 华为近几年处境不好会不会有顾虑</h3><p>尽管华为近年来因外部因素而面临挑战，但该公司拥有强大而有韧性的企业文化。我相信，从长远来看，华为对创新、客户满意度和员工发展的承诺将继续推动其成功。</p><h2 id="行为问题" tabindex="-1"><a class="header-anchor" href="#行为问题" aria-hidden="true">#</a> 行为问题</h2><h5 id="没学过的课程让你学你会怎么去学" tabindex="-1"><a class="header-anchor" href="#没学过的课程让你学你会怎么去学" aria-hidden="true">#</a> 没学过的课程让你学你会怎么去学</h5><ul><li><p>制定计划：可以帮助你更好地组织和管理你的时间，并确保你在学习过程中不会错过任何重要的信息。</p></li><li><p>练习：练习是掌握新知识的关键。通过练习，你可以更好地理解和应用所学的知识。</p></li><li><p>输出：输出是另一种非常有效的学习方法。通过写作、演讲或其他方式输出所学的知识，可以帮助你更好地理解和记忆所学的内容。</p></li><li><p>寻求帮助：可以向老师、同学或其他专业人士寻求帮助。</p></li></ul><h5 id="如何实现目标" tabindex="-1"><a class="header-anchor" href="#如何实现目标" aria-hidden="true">#</a> 如何实现目标</h5><ul><li>制定计划：制定一个明确的计划可以帮助你更好地组织和管理你的时间，并确保你在实现目标的过程中不会错过任何重要的信息。</li><li>采取行动：采取行动是实现目标的关键。不要让拖延症阻碍你的进展，而是尽快采取行动。</li><li>进度管理：</li><li>寻求支持：如果你遇到了困难或需要帮助，不要害怕寻求支持。可以向朋友、家人或其他专业人士寻求帮助。</li><li>管理压力：压力是实现目标时可能会遇到的一个常见问题。了解如何管理压力并保持积极心态可以帮助你更好地实现目标。</li></ul><h5 id="压力怎么办" tabindex="-1"><a class="header-anchor" href="#压力怎么办" aria-hidden="true">#</a> 压力怎么办</h5><ul><li>运动：运动可以帮助你释放紧张和焦虑的情绪，并提高你的心理和身体健康水平。</li><li>找到支持：寻求支持可以帮助你缓解压力。可以向朋友、家人或其他专业人士寻求帮助。</li><li>改变思维方式：改变思维方式可以帮助你更好地应对压力。尝试采用积极的思维方式，例如专注于解决问题而不是担心它们。</li></ul><h5 id="怎么处理工作冲突" tabindex="-1"><a class="header-anchor" href="#怎么处理工作冲突" aria-hidden="true">#</a> 怎么处理工作冲突</h5><ul><li>清楚自己工作的需求和目标，积极与同事和上级沟通，了解他们的需求和目标。</li><li>找到共同点，以达成共识为目标。</li><li>寻找解决方案，以满足双方的需求和目标。</li></ul><h5 id="🌟-看待加班" tabindex="-1"><a class="header-anchor" href="#🌟-看待加班" aria-hidden="true">#</a> 🌟 看待加班</h5><ul><li><p>加班可以帮助业务目标的实现，但如果是因为工作目标和计划制定不当，导致不得不加班，就应该在下次做好规划，尽量避免。</p></li><li><p>另外也应该提升工作效率，在规定时间内保质保量完成工作，拒绝无效的加班或者是盲目的加班。</p></li></ul><h5 id="你周围人和你自己是怎么看待华为和华为的压力" tabindex="-1"><a class="header-anchor" href="#你周围人和你自己是怎么看待华为和华为的压力" aria-hidden="true">#</a> 你周围人和你自己是怎么看待华为和华为的压力</h5><p>周围人：有学长去年入职了华为，有提到华为的压力和强度都不小，但是一年来的提升和收获也很大。我认为一分耕耘一分收获，个人需要适应这样的环境和竞争激烈的时代，并不断提升自我。</p><h5 id="喜欢的工作氛围" tabindex="-1"><a class="header-anchor" href="#喜欢的工作氛围" aria-hidden="true">#</a> 喜欢的工作氛围</h5><p>是开放、积极、团结和充满挑战性的。我喜欢能够自由地表达自己的想法，与同事们进行积极的沟通和合作，并且愿意互相帮助和支持。我希望我的工作环境中有许多挑战性的项目，可以激励我不断探索和学习新的技术和知识，从而不断提高自己的技能。</p><blockquote><p>接着，我会解释为什么这种工作氛围适合我。</p></blockquote><p>在我过去的比赛经历中，小组团队都是积极、团结、自由研讨的氛围，这样的氛围充分发挥了我们各自的灵感，并在思维的碰撞中，我们很高效地解决很多富有挑战的技术难题，遇到难以克服的问题时我们也可以及时发现问题转变思路来进行化解，来说明这种工作氛围对我个人的成长和发展有何益处。在这样的氛围中可以更好地发挥自己的能力，并对公司的业务和目标做出更好的贡献。</p><blockquote><p>最后，我也会表示</p></blockquote><p>最后，我也愿意适应不同的工作氛围，并且能够快速地融入公司的文化和团队中，与同事们进行合作，实现共同的目标。</p><h2 id="社团与爱好" tabindex="-1"><a class="header-anchor" href="#社团与爱好" aria-hidden="true">#</a> 社团与爱好</h2><h3 id="社团经历" tabindex="-1"><a class="header-anchor" href="#社团经历" aria-hidden="true">#</a> 社团经历</h3><h3 id="爱好" tabindex="-1"><a class="header-anchor" href="#爱好" aria-hidden="true">#</a> 爱好</h3><ol><li>看技术博客，比如掘金社区以及一些公众号上有很多优质的技术总结或最佳实践，</li><li>写技术文档，</li><li>参与各类大赛，可以组建团队一起解决问题、迎接挑战，可以结识新的伙伴或增进友谊、同时也可以学到一些新的技术并将所学知识付诸实践。</li><li>兴趣爱好的多样性：强调你有多方面的兴趣爱好，展示你的多元化和丰富性。可以列举几个你特别喜欢的爱好，涵盖不同领域，例如体育、艺术、音乐、阅读、旅行等。</li><li>与技能或品质的关联：将你的爱好与技能或品质联系起来，以展示你在其他领域的积极影响和发展。例如，如果你喜欢户外运动，可以提到你的团队合作精神、坚韧不拔的毅力和解决问题的能力。</li><li>学习新技能：强调你愿意学习新的事物和开拓自己的兴趣范围。你可以提到你正在学习新的技能或正在尝试新的爱好，并解释你是如何通过自学、参加课程或培训来提升自己的。</li><li>与职位相关的爱好：如果你的爱好与所申请的职位相关，可以强调这方面的优势。例如，如果你申请软件开发工程师的职位，你可以提到你喜欢编写代码、参与开源项目或者创建个人项目。</li></ol><h5 id="有没有什么团队合作的爱好" tabindex="-1"><a class="header-anchor" href="#有没有什么团队合作的爱好" aria-hidden="true">#</a> 有没有什么团队合作的爱好</h5><p>回答1：我业余喜欢参加一些团队竞赛，这要求我与队友密切协作，共同设计和实现解决方案。这些活动不仅提升了我的技术能力，也锻炼了我的团队意识和沟通技巧。</p><p>回答1：除了我的热情和兴趣向往软件开发这个领域外，我还有一些与团队合作相关的爱好。首先，我喜欢参加编程竞赛，这要求我与队友密切协作，共同设计和实现解决方案。这些活动不仅培养了我的技术能力，也锻炼了我的团队合作和沟通技巧。</p><blockquote><p>我喜欢参与开源软件项目的贡献。这给我提供了一个与其他开发者合作的机会，在团队环境中共同解决问题和改进软件。</p></blockquote><p>问题2：有什么需要团队合作的爱好？</p><p>回答2：作为软件开发工程师，我深知团队合作在项目中的重要性。除了以上提到的开源项目和编程竞赛，我也参与了学校的软件开发团队。我们一起构思、设计和实现项目，分工合作以达成共同目标。在团队中，我承担着一些协调和沟通的职责，与其他成员紧密合作，共同解决技术挑战并按时交付高质量的代码。通过这些经历，我提高了团队协作能力、灵活应对变化和与他人合作的能力。</p><h2 id="offer-对比" tabindex="-1"><a class="header-anchor" href="#offer-对比" aria-hidden="true">#</a> offer 对比</h2><h4 id="有没有别的offer" tabindex="-1"><a class="header-anchor" href="#有没有别的offer" aria-hidden="true">#</a> 有没有别的Offer</h4><p>目前还有京东在走流程，已经通过终面了，有一家游戏外企的Offer，不过由于职业规划和时间安排的问题，我已经拒绝了。</p><h4 id="如何选择offer" tabindex="-1"><a class="header-anchor" href="#如何选择offer" aria-hidden="true">#</a> 如何选择Offer</h4><p>京东那边我面试是算法工具部的岗位，虽然也是比较核心部门的岗位，但是从技术契合度和个人兴趣的角度，我都更加倾向于华为。通过在华为和前两轮面试面试官的交谈，我对我们部门的工作非常感兴趣。</p><h2 id="反问" tabindex="-1"><a class="header-anchor" href="#反问" aria-hidden="true">#</a> 反问</h2><ul><li>我们部门具体业务</li><li>进去以后具体日常做的工作</li><li>流程</li></ul><h2 id="面经" tabindex="-1"><a class="header-anchor" href="#面经" aria-hidden="true">#</a> 面经</h2><ol start="2"><li><p>简单介绍项目（不是技术的那种介绍，就是说说这个项目的背景，性质，你的分工等基本情况）</p></li><li><p>你学过哪些相关课程，以及某某课你学过吗</p></li><li><p>项目背景成长点，</p></li><li><p>Chatgpt 优势劣势，</p></li><li><p>二次开发方向，</p></li><li><p>有没有组织过社团活动，</p></li><li><p>为什么加入华为，华为能给你提供什么(最后两个问题回答得稀碎</p></li><li><p>深挖简历（不谈技术）</p></li><li><p>聊项目</p></li><li><p>聊学习经历</p></li><li><p>聊家庭企业个人情况 还有目标啥的</p></li><li><p>总得来说不谈技术 主要看你的个人经历 个人品质 还有软实力这种</p></li><li><p>项目重难点 成就点 如何解决之类的现实问题</p></li><li><p>主管面就是纯聊天，没涉及到技术问题</p></li><li><p>爱好</p></li><li><p>怎么处理工作冲突</p></li><li><p>看待加班</p></li><li><p>还问了你周围人和你自己是怎么看待华为和华为的压力，</p></li><li><p>还有遇到的挫折，</p></li><li><p>还有hash函数，</p></li><li><p>以及对一个字符串表达式求输出值</p></li><li><p>主管面就是简单聊你的竞赛经历，</p></li><li><p>如何团队协作，</p></li><li><p>企业文化，</p></li><li><p>加班，</p></li><li><p>以及自己比较难过的事情如何调节这些，</p></li><li><p>反正问的五花八门</p></li><li><p>自我介绍</p></li><li><p>计划读研吗？</p></li><li><p>工作的规划，以后想从事哪方面的工作？</p></li><li><p>简单的谈谈你做的项目，谈谈你是如何收集信息的，怎么定目标，怎么实现的？</p></li><li><p>为什么会选择这个项目？</p></li><li><p>GitHub上面有对应的开源项目嘛？</p></li><li><p>业务方案是你们自己写的还是有导师提供的？</p></li><li><p>怎么设计项目整体的业务方向？</p></li><li><p>学习中对外部的一些先进的构架有了解吗？</p></li><li><p>团队中遇到问题怎么去说服别人，或者你是怎么被别人说服的？</p></li><li><p>多人协作中遇到了那些困难嘛？有没有遇到不配合的？</p></li><li><p>怎么学习一些新的技术，ChatGPT学习了哪些东西？</p></li><li><p>生活中有没有定一些目标？为了这些目标做了哪些准备？</p></li><li><p>有没有一些事情，成功的希望不是很大，但是你还是去做了，最后还是有收获的？</p></li><li><p>怎么看待华为现在在网上的一些反馈</p></li><li><p>自我介绍</p></li><li><p>信安专业介绍一下了解的加解密算法</p></li><li><p>说一下现在哪些密码足够安全，哪些被破解了</p></li><li><p>介绍一下项目</p></li><li><p>项目开发过程中有没有遇到什么困难？如何解决的</p></li><li><p>有没有什么爱好？（感觉寄在这里了）</p></li></ol><p>答得是下围棋 阅读技术书籍</p><ol start="6"><li>追问：有没有什么需要团队合作的爱好？</li></ol><p>回答没有，然后秒挂。</p><ol><li><p>看了很多面经基本都说华为的主管面是聊天。导致我在主管面的项目的时候大谈技术细节</p></li><li><p>结果这个主管好像是技术主管，直接指出技术使用的不合理，然后疯狂抠细节，我真的当时想找坑钻进去</p></li><li><p>后面复盘这个面试官确实很有技术人的气质，应该早点注意到，然后就不关公面前耍大刀</p></li></ol>',106),p=[r];function d(n,t){return a(),l("div",null,p)}const o=i(h,[["render",d],["__file","主管面.html.vue"]]);export{o as default};
